import React from 'react'

function Envelope({fromP, toP}) {
    console.log(fromP);
    console.log(toP);
    return (
        <>
        <div>
            { toP.fullName } 
            { toP.address } 
            { toP.cityStateZip }
        </div>
        <div>
            { fromP.fullName }
            { fromP.address }
            { fromP.cityStateZip }
        </div>
        </>
    )
}

export default Envelope;
